import React from "react";
import "./components.css";
import "./classes.js";
import Room4 from "./room4.js";
import Result from "./result.js"


class Online extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      phase:0,
      results: [],
      levels: {
        rent: ["5万円", "5.5万円", "6万円", "7万円"], 
        extent: ["6.2畳", "6.5畳", "7.1畳", "8畳"],
        distance: ["徒歩5分", "徒歩15分", "徒歩20分"], 
        bathType: ["ユニットバス", "セパレート"],
        height: ["1階", "3階", "5階"],
        old: ["築10年", "築15年", "築20年"],
        stoveNum: ["1個", "2個"],
        direction: ["東", "西", "南", "北"],
        waterBill: ["従量課金", "料金固定"],
        security: ["オートロックなし", "オートロックあり"],
        age: ["25歳", "30歳", "35歳"],
        womenRate: ["30%", "50%", "70%"],
        pet: ["ペット禁止", "ペット可能"],
        smoke: ["禁煙", "喫煙可"]
      }, 
      profiles: [[0, 2, 1, 1], [2, 1, 1, 0]]
    };
    this.addChoiceA = this.addChoiceA.bind(this);
    this.addChoiceB = this.addChoiceB.bind(this);
  }

  addChoiceA(){
    this.setState({phase:this.state.phase+1, results:this.results.push("A")});
  }
  addChoiceB(){
    this.setState({phase:this.state.phase+1, results:this.results.push("B")});
  }

  createTwoRooms(){
    return(
      <div className="all-wrapper">
        <Room4 rent={this.state.levels.rent[this.state.profiles[this.state.phase*2][0]]} extent={this.state.levels.extent[this.state.profiles[this.state.phase*2][1]]} distance={this.state.levels.distance[this.state.profiles[this.state.phase*2][2]]} bathType={this.state.levels.bathType[this.state.profiles[this.state.phase*2][3]]} label={"A"} click={this.addChoiceA} />
        <Room4 rent={this.state.levels.rent[this.state.profiles[this.state.phase*2+1][0]]} extent={this.state.levels.extent[this.state.profiles[this.state.phase*2+1][1]]} distance={this.state.levels.distance[this.state.profiles[this.state.phase*2+1][2]]} bathType={this.state.levels.bathType[this.state.profiles[this.state.phase*2+1][3]]} label={"B"} click={this.addChoiceB} />
      </div>
    )
  }

  render(){
    if(this.state.phase === 0){
      return this.createTwoRooms();
    }
    else{
      return < Result results={this.setState.results}/>
    }
  }
}

export default Online;
